import React from 'react';

const ToDoList = (props) =>{
    
    const sidebar = (
        <ul>
            {props.posts.length ? 
            props.posts.map((post) =>
            <li key={post.id}>
                <input  type='checkbox' id={post.id}/>
                <label htmlFor={post.id}> {post.title}</label>
            </li>
            ): (<p>df</p>)}
        </ul>
    );
    return (
        <div className='list'>
            {sidebar}
        </div>
    )
}

export default ToDoList;
